import React, { useState } from 'react'
import Navbar from '../../../components/Navbar'
import { Link } from 'react-router-dom'
import Footer from '../../../components/Footer';
import FormFields from '../Form_Fields';

const CreateDependent = () => {
    const [customer, setCustomer] = useState(null);
    const [message, setMessage] = useState("");
    const [writingDirection, setWritingDirection] = useState("ltr");
  return (
    <><Navbar /><main>
          <div class="utilities">
              <Link to={`/customers/${customer.id}`}><i class="fas fa-arrow-left"></i> Customer {customer.name} {customer.surname}</Link>
              <p class="message">
                  {message}
              </p>
          </div>
          <h1 class="title">Add Dependent</h1>
          <section class="khamco-wrapper" dir={writingDirection}>
              <form action="/customers/create-dependent/<%= customer.id %>" method="POST">
                  <FormFields />
              </form>
          </section>
      </main><Footer /></>
  )
}

export default CreateDependent
